import {motion, useTransform, useScroll} from "framer-motion";
import {useEffect, useRef} from 'react';

import about from "../images/about.jpeg";
import projects from "../images/projects.jpeg";

const About = () => {
    return (
        <>
            <div className="w-[90%] h-full aspect-[16/9] border-2 p-2 mx-auto">
                <img src={about} alt="about" className="w-full h-full"></img>
            </div>
            <div className="w-[90%] h-full aspect-[16/9] border-2 p-2 mx-auto">
                <img src={projects} alt="about" className="w-full h-full"></img>
            </div>
        </>
    )
}

export default About;
